description.text:
If you wish to change the parameters, then download the .scad file and adjust as necessary.  However the default settings should fit any E61 group handle.
The stl, has the following parameters  
<code >keyHeight = 22;  
keyWidth = 21;  
tampHeight = 3;  
tampDiameter = 59;  
thickness = 12;  
innerHeight = 75;  
innerDiameter = 73;  </code>
I printed it with 0.3mm layer height, 2.4mm bottom/top thickness (6 layers), 1.2mm shell thickness (3 layers), 30% fill.
